import React from 'react'
import './App.css';
import io from 'socket.io-client';
import { TextField } from '@material-ui/core';

const socket = io.connect("http://localhost:3001")

function App() {
  return (
    <div className="app">
      <h3> Enter Room Details </h3>
      <TextField id="outlined-basic" label="Enter Your Name..." variant="outlined" type="text" placeholder="" />
      <TextField id="outlined-basic" label="Outlined" variant="outlined" type="text" placeholder="Enter Room ID..." />
      <button type="submit">
        Join
      </button>
    </div>
  );
}

export default App;
